from django.test import TestCase

# Create your tests here.


class CriaTicketTestCase(TestCase):

    def test_se_a_image_recebedida_esta_sendo_corretamente_recortada_e_feito_upload(self):

        esperado = 'data:image/png;base64,'
        
        recebido = '<p><img src="data:image/png;base64," /></p>'
        
        
        start = recebido.find('"') + 1
        
        recorte_start = recebido[start:]
        
        end = recorte_start.find('"')
        
        recorte_end = recorte_start[:end]
        
        recebido = recorte_end
     
        self.assertEqual(recebido, esperado)